      bird: this.props.bird,
    };
  }

  componentWillReceiveProps({bird}) {
    this.setState({...this.state,birdssomeProp})
  }

  render() {
    return (
      <div className="container1 ">
          <h1>-{this.state.testVal}</h1>
        <Loader
          type="ThreeDots"
          color=""
          height={50}
          width={400}
          offset={150}
          visible={this.state.busy}
          className="loaderCon col-centered spinz"
